Andrea

-----Original Message-----
From: EVP-ITC@yahoogroups.com [mailto:EVP-ITC@yahoogroups.com] On Behalf
Of Sumption Frank
Sent: Wednesday, June 21, 2006 4:07 PM
To: EVP-ITC@yahoogroups.com
Subject: [EVP-ITC] A &quot;sister&quot; Princess

I probably don&#39;t spell this name right either, but Kielah (Key-lah) is a
sister of Quierah, but she&#39;s remains on one of the ships.

 Frank





